sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
   try{
    var obvUtil = new OracleBootVolumeUtils();
    obvUtil.validateInputVariables(inputs, outputs);
   	obvUtil.validateMandatoryVariables(inputs,["availabilityDomain","tenancyId","sourceDetails"]);
     if(inputs.tenancyId && inputs.compartmentId){
		inputs.compartmentId = inputs.compartmentId;
    }
    else if(inputs.tenancyId){
    	inputs.compartmentId = inputs.tenancyId;
    }
  var payload = obvUtil.createPayload(inputs,["availabilityDomain","compartmentId","sourceDetails","displayName","isAutoTuneEnabled","kmsKeyId","sizeInGBs","vpusPerGB"]);                                  
  obvUtil.trimValues(inputs.freeformTags);
  var tags = obvUtil.createTagsPayload(inputs.freeformTags);  
  if(Object.keys(tags).length){
        payload.freeformTags = tags;
  }
   outputs.payload = JSON.stringify(payload);
  }
  catch(ex){

    throw new Error("Mandatory Fields Should be provided");

  }
})(inputs, outputs);

